import React from 'react';
import HeaderContainer from '../containers/common/HeaerContainer';

const PostPage = () => {
  return (
    <>
      <HeaderContainer />
      <img
        src="frontend/src/images/main.png"
        alt="main image"
        width="1200"
        height="800"
      />
      메인
    </>
  );
};

export default PostPage;
